import React, { useState } from "react";

function App() {
  const [count1, setCount1] = useState(0);
  const [count2, setCount2] = useState(0);

  function handleButtonClick1() {
    setCount1(count1 + 1);
  }

  function handleButtonClick2() {
    setCount2(count2 + 1);
  }

  return (
    <div>
      <button onClick={handleButtonClick1}>hello{count1}</button>
      <button onClick={handleButtonClick2}>hello world{count2}</button>
    </div>
  );
}

export default App;
